нную категорию.Выделим три наиболее важных:Специализация на решении сложнейших клинических случаев имплантации и протезирования.Принятая к исполнению политика качества и внедрение аналитических инструментов позволяет нам спрогнозировать возможные риски и принять наиболее оптимальный вариант. Многие наши Клиенты рассказывали, что по своему месту жительства им просто отказывали в лечении!Демократичная ценовая политика.Мы грамотно оптимизировали рабочий процесс и снизили затраты. У нас единый прейскурант вне зависимости от гражданства пациента;Гарантийная поддержка пациентов.На медицинские услуги предоставляются широкие гарантии. В случае наступления гарантийного случая все работы будут проведены бесплатно.За последние два года мы стали реальными лидерами в организации и проведении стоматологического лечения. Мы приняли пациентов из России, Казахстана, Украины, Литвы, Латвии, Эстонии, Польши, Германии, Швеции, Финляндии, Израиля, США, Канады, Австралии и еще десятка государств. Кроме того, к нам обращаются и со всех уголков Беларуси.По результатам проведенного в ноябре-декабре 2018 года опроса пациентов  получили великолепную оценку работы: 96,4% респондентов поставили нам высшую оценку. Большое вам спасибо за доверие!самостоятельно оказывает сервисные услуги по организации лечения “под ключ”: дистанционные бесплатные консультации, трансферы, прохождение дополнительного медицинского обследования в Минске.формируем положительный имидж белорусской стоматологии и медицинской отрасли в целом. Мы открыты всему миру.Популярные стоматологические услуги в Беларуси.Самой популярной стоматологической услугой, несомненно, является имплантация зубов. Благодаря высокому качеству работ, гарантии положительного результата мы заслужили уважение и отличную репутацию среди Клиентов.Мы работаем с линейкой имплантов Megagen, Noris, а также системой премиум-уровня Straumann и Nobel. В нашем распоряжении собственные зуботехническая лаборатория и рентген-кабинет с компьютерным томографом пос